import React from "react";
import styles from "../../styles/communitypage.module.scss";

interface Itemprops {
    title: string;
    date?: string;
    time: string;
    address: string;
    people: string;
    description: string;
}

const Item = ({ title, date, time, address, people, description } : Itemprops) => {
    return (
        <div className={styles.postItem}>
            <h2>{title}</h2>
            {date && <p>날짜: {date}</p>}
            <p>시간: {time}</p>
            <p>장소: {address}</p>
            <p>인원: {people}</p>
            <p>{description}</p>
        </div>
    );
};

export default Item;
